import styled from "styled-components";

const StyledHome = styled.div`
  background-image: linear-gradient(#0097a7, #4fbf9e, #ccff90);
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 667px;
  min-width: 375px;
`;

export default StyledHome;
